    return (
      <div>
        <Navbar color="light" light fixed='true' className='headerNavbar'>
        <div className="container-fluid ContainerFluid">
          <div className="row w-100 rowParent">
            <div className="col-lg-4 col-md-3 col-sm-2 d-flex logoParent">
